$(window).load(function(){var i={imgIncrease:100,effectDuration:400,imgWidth:$(".thumbnailWrapper img").find("img").width(),imgHeight:$(".thumbnailWrapper img").find("img").height()};$(".thumbnailWrapper img").css({width:i.imgWidth,height:i.imgHeight}),$(".thumbnailWrapper img").hover(function(){$(this).find("img").stop().animate({width:parseInt(i.imgWidth)+i.imgIncrease,left:i.imgIncrease/2*-1,top:i.imgIncrease/2*-1},{duration:i.effectDuration,queue:!1}),$(this).find(".caption:not(:animated)").slideDown(i.effectDuration)},function(){$(this).find("img").animate({width:i.imgWidth,left:0,top:0},i.effectDuration),$(this).find(".caption").slideUp(i.effectDuration)})});